import {useState} from "react"




const Child = (props) => {
const [data, setData] = useState([])
  const sendMessage = () => {
    const { websocket } = props;
    try{
        websocket.send(JSON.stringify({"topic": "subscribe", "to": "EURUSD:CUR"})).then((result) => setData(result))
        console.log(data)
    } catch (error) {
        console.log(error)
    }
  };
  return <button onClick={sendMessage}>child</button>;
};
export default Child;
